import React from "react";

const HomePage = () => {
  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center">
      {/* Navigation Bar */}
      <nav className="bg-gray-200 p-4 w-full flex justify-between items-center shadow-md">
        <div className="font-bold text-lg">SESDC/LOGO HERE</div>
        <div className="flex gap-8">
          <a href="#" onClick={(e) => e.preventDefault()}>Home</a>
          <a href="#" onClick={(e) => e.preventDefault()}>About</a>
          <a href="#" onClick={(e) => e.preventDefault()}>Help</a>
          <a href="#" onClick={(e) => e.preventDefault()}>Contact Us</a>
        </div>
        <div className="nav-buttons flex gap-4">
          <button className="register-btn">Register</button>
          <button className="login-btn">Login</button>
        </div>
      </nav>

      {/* Main Section with a Box */}
      <section className="main-container">
        <div className="box-container">
          {/* Left Content: Text and Button */}
          <div className="text-content">
            <h1 className="text-2xl font-bold">A user-friendly</h1>
            <h1 className="text-2xl font-bold">microgrid design tool</h1>
            <button className="design-tool-button">Open Design Tool</button>
          </div>

          {/* Right Content: Graph Placeholder */}
          <div className="graph-placeholder">Graph Placeholder</div>
        </div>
      </section>

      {/* Overview Section */}
      <section className="overview-container">
        <div className="overview-text">
          <p>Overview of Project: Purpose, why it was created?</p>
          <button className="get-started">Get Started!</button>
        </div>
      </section>
    </div>
  );
};

export default HomePage;
